import React from "react";

const About = () => {
    return (
        <div>
          <h2>About Me</h2>
          <div>
            <span>Computer Systems Engineer grad who enjoys working in software development, utilizing a Full-Stack environment. Skilled in problem solving with Java, PHP, Laravel, JavaScript, React, Node.JS, and SQL. Eager and focused on gaining more real world experience using different tech stacks, as well as honing my programming skills.</span>
          </div>
        </div>
    );
}

export default About;
